import React from "react";
import styled from "styled-components";

const MainActivityContainer = styled.div`
  max-width: 1280px;
  height: 683px;
  margin: 0 auto;
  padding-left: 40px;
  padding-right: 40px;
  box-sizing: border-box;
  display: grid;
  grid-template-columns: 121fr 146fr 927fr 86fr;
  grid-template-rows: 220fr 463fr;
  .MainActivityLeft {
    width: 121px;
    height: 48px;
    grid-column: 1 / span 1;
    grid-row: 1 / span 1;
    font-size: 32px;
    font-family: Kanit;
    font-weight: bold;
    line-height: 48px;
    margin-top: 100px;
  }
  .MainToActivity {
    display: block;
    text-decoration: none;
    font-size: 16px;
    font-family: NanumSquareR;
    line-height: 18px;
    color: #afafaf;
    margin-top: 13px;
  }
  .MainActivityTop {
    grid-column: 3 / span 1;
    grid-row: 1 / span 1;
    width: 267px;
    height: 20px;
    font-family: NanumSquareR;
    font-size: 18px;
    line-height: 34px;
    color: #101010;
    margin-top: 113px;
  }
`;

function MainActivity() {
  return (
    <MainActivityContainer>
      <div className="MainActivityLeft">
        Activity
        <a href="#" className="MainToActivity">
          View Detail -
        </a>
      </div>
      <div className="MainActivityTop">EC에 오면 이런 활동을 할 수 있어요!</div>
      <div className="MainActivityMain">
        <div className="MainActivityText1">
          <div>잘 하는데</div>
          <div>
            신입생 스터디 희망스터디 개설 재학생 세미나 졸업생 세미나 EC
            어드벤스 팀별 공모전 개발 컨퍼런스
          </div>
        </div>
        <div className="MainActivityText2">
          <div>잘 놀기까지</div>
          <div>
            신입생 환영회 봄소풍 및 M.T. 스승의 날 창립기념일 동아리 회식 겨울
            M.T. 매달 생일 챙겨줌
          </div>
        </div>
        <div className="MainActivityPhoto">
          <div className="MainActivityPhoto1"> </div>
          <div className="MainActivityPhoto2"> </div>
          <div className="MainActivityPhoto3"> </div>
        </div>
      </div>
    </MainActivityContainer>
  );
}

export default MainActivity;
